import React, { useState } from 'react';
import { Upload, ImageIcon, Loader } from 'lucide-react';

const ObjectDetection = () => {
  const [originalImage, setOriginalImage] = useState(null);
  const [annotatedImage, setAnnotatedImage] = useState(null);
  const [counts, setCounts] = useState(null);
  const [isLoading, setIsLoading] = useState(false);
  const [dragActive, setDragActive] = useState(false);

  const handleImageUpload = async (file) => {
    if (!file) return;

    setIsLoading(true);
    const formData = new FormData();
    formData.append('file', file);

    try {
      const response = await fetch('http://localhost:8000/detect', {
        method: 'POST',
        body: formData,
      });

      const data = await response.json();
      setOriginalImage(`data:image/jpeg;base64,${data.original_image}`);
      setAnnotatedImage(`data:image/jpeg;base64,${data.annotated_image}`);
      setCounts(data.counts);
    } catch (error) {
      console.error('Error:', error);
    } finally {
      setIsLoading(false);
    }
  };

  const handleDrag = (e) => {
    e.preventDefault();
    e.stopPropagation();
    if (e.type === "dragenter" || e.type === "dragover") {
      setDragActive(true);
    } else if (e.type === "dragleave") {
      setDragActive(false);
    }
  };

  const handleDrop = (e) => {
    e.preventDefault();
    e.stopPropagation();
    setDragActive(false);
    
    if (e.dataTransfer.files && e.dataTransfer.files[0]) {
      handleImageUpload(e.dataTransfer.files[0]);
    }
  };

  return (
    <div className="min-h-screen bg-gray-900 text-gray-100 p-8">
      <div className="max-w-6xl mx-auto">
        <h1 className="text-3xl font-bold mb-8 text-center bg-gradient-to-r from-blue-500 to-purple-500 bg-clip-text text-transparent">
          Object Detection Analysis
        </h1>

        <div 
          className={`mb-8 p-8 border-2 border-dashed rounded-lg text-center transition-all
            ${dragActive ? 'border-blue-500 bg-blue-500/10' : 'border-gray-700 hover:border-gray-600'}`}
          onDragEnter={handleDrag}
          onDragLeave={handleDrag}
          onDragOver={handleDrag}
          onDrop={handleDrop}
        >
          <div className="flex flex-col items-center gap-4">
            <Upload className="w-12 h-12 text-gray-400" />
            <div className="text-lg">
              Drop your image here or{' '}
              <label className="text-blue-400 hover:text-blue-300 cursor-pointer">
                browse
                <input
                  type="file"
                  className="hidden"
                  accept="image/*"
                  onChange={(e) => handleImageUpload(e.target.files[0])}
                />
              </label>
            </div>
            <p className="text-sm text-gray-500">Supports: JPG, PNG, WEBP</p>
          </div>
        </div>

        {isLoading && (
          <div className="flex items-center justify-center gap-2 text-blue-400 my-8">
            <Loader className="w-6 h-6 animate-spin" />
            <span>Processing image...</span>
          </div>
        )}

        {counts && (
          <div className="mb-8 p-6 bg-gray-800 rounded-lg shadow-lg">
            <h2 className="text-xl font-bold mb-4 text-gray-100">Detection Results</h2>
            <div className="grid grid-cols-3 gap-4">
              {Object.entries(counts).map(([className, count]) => (
                <div key={className} className="bg-gray-700 p-4 rounded-lg">
                  <div className="text-sm text-gray-400">Total {className}</div>
                  <div className="text-2xl font-bold text-blue-400">{count}</div>
                </div>
              ))}
            </div>
          </div>
        )}

        {(originalImage || annotatedImage) && (
          <div className="grid md:grid-cols-2 gap-8">
            {originalImage && (
              <div className="bg-gray-800 p-6 rounded-lg shadow-lg">
                <h3 className="font-bold mb-4 flex items-center gap-2">
                  <ImageIcon className="w-5 h-5" />
                  Original Image
                </h3>
                <img 
                  src={originalImage} 
                  alt="Original" 
                  className="w-full rounded-lg"
                />
              </div>
            )}
            
            {annotatedImage && (
              <div className="bg-gray-800 p-6 rounded-lg shadow-lg">
                <h3 className="font-bold mb-4 flex items-center gap-2">
                  <ImageIcon className="w-5 h-5" />
                  Detected Objects
                </h3>
                <img 
                  src={annotatedImage} 
                  alt="Annotated" 
                  className="w-full rounded-lg"
                />
              </div>
            )}
          </div>
        )}
      </div>
    </div>
  );
};

export default ObjectDetection;
